import { useEffect, useState } from "react";
import Header from "../components/Header";
import TradeForm from "../components/TradeForm";
import TradeList from "../components/TradeList";
import { fetchHello, fetchTime, fetchTrades } from "../api/api";

export default function Dashboard() {
  const [message, setMessage] = useState("Loading...");
  const [time, setTime] = useState("Loading...");
  const [trades, setTrades] = useState([]);

  // For HTTP price API
  const [symbol, setSymbol] = useState("");
  const [priceData, setPriceData] = useState(null);

  // For live WebSocket price streaming
  const [liveSymbol, setLiveSymbol] = useState("");
  const [livePrice, setLivePrice] = useState(null);
  const [wsError, setWsError] = useState("");

  // Load initial data from backend
  useEffect(() => {
    fetchHello().then((d) => setMessage(d.message));
    fetchTime().then((d) => setTime(d.server_time));
    fetchTrades().then((d) => setTrades(d));
  }, []);

  // Call HTTP API for one-time price
  const getMarketPrice = async () => {
    if (!symbol) return;
    const res = await fetch(`/api/price?symbol=${symbol}`);
    const data = await res.json();
    setPriceData(data);
  };

  // Connect to backend WebSocket for live streaming
  const connectLiveStream = () => {
    if (!liveSymbol) return;

    setWsError("");
    setLivePrice(null);

    // Connect to backend WS endpoint
    const ws = new WebSocket(`ws://localhost:8080/api/live?symbol=${liveSymbol}`);

    ws.onopen = () => {
      console.log("WebSocket connected for:", liveSymbol);
    };

    ws.onerror = (err) => {
      console.error("WebSocket Error:", err);
      setWsError("WebSocket error. Check backend logs.");
    };

    ws.onmessage = (event) => {
      try {
        const data = JSON.parse(event.data);

        // Finnhub sends trade ticks like:
        // { type: "trade", data: [{ p: 178.23, s: "AAPL", t: 12345 }] }
        if (data.type === "trade" && data.data?.length > 0) {
          setLivePrice(data.data[0].p);
        }
      } catch (err) {
        console.error("Invalid WS message:", err);
      }
    };

    ws.onclose = () => {
      console.log("WebSocket closed for", liveSymbol);
    };

    // Cleanup WebSocket on component unmount / reconnect
    return () => ws.close();
  };

  return (
    <div style={{ padding: 20 }}>
      <Header />

      {/* SERVER INFO */}
      <p>{message}</p>
      <p>Server Time: {time}</p>

      <hr />

      {/* PRICE API SECTION */}
      <h2>üîç One-time Price (HTTP API - Finnhub)</h2>

      <input
        type="text"
        placeholder="Enter Symbol (AAPL, TSLA, BTCUSDT...)"
        value={symbol}
        onChange={(e) => setSymbol(e.target.value)}
        style={{ marginRight: 10 }}
      />
      <button onClick={getMarketPrice}>Get Price</button>

      {priceData && (
        <pre
          style={{
            marginTop: 20,
            padding: 15,
            background: "#eee",
            borderRadius: 5,
          }}
        >
          {JSON.stringify(priceData, null, 2)}
        </pre>
      )}

      <hr />

      {/* LIVE PRICE STREAM SECTION */}
      <h2>üì° Live Price Streaming (WebSocket)</h2>

      <input
        type="text"
        placeholder="Enter Symbol (AAPL, TSLA, BINANCE:BTCUSDT)"
        value={liveSymbol}
        onChange={(e) => setLiveSymbol(e.target.value)}
        style={{ marginRight: 10 }}
      />
      <button onClick={connectLiveStream}>Start Stream</button>

      {wsError && <p style={{ color: "red" }}>{wsError}</p>}

      {livePrice && (
        <h3 style={{ marginTop: 20 }}>
          Live Price of {liveSymbol}:{" "}
          <span style={{ color: "green" }}>{livePrice}</span>
        </h3>
      )}

      <hr />

      {/* TRADING SECTION */}
      <TradeForm setTrades={setTrades} />
      <TradeList trades={trades} />
    </div>
  );
}
